import styled from "styled-components";

export const MainWrapper = styled.div`
  width: 100%;
  height: 100%;
  min-height: 811px;

  background: fixed rgba(28, 28, 28, 0.2) url(/img/header-bckg-1440.jpg)
    no-repeat;
`;
